import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div id='archive-container'>
        <div id='search'>
          <input />
        </div>
        <div id='title-count'>
          <h3></h3>
        </div>
        <div id='email'>
          <div></div>
          <h1>mappped items</h1>
        </div>
      </div>
    );
  }
}

export default App;
